import testimage from '../../images/test-image.png';

function MoviesCard() {
    return (
        <div className="moviesCard">
            <img className="moviesCard__image" src={testimage} alt="Изображение фильма"></img>
            <div className="moviesCard__container">

            </div>
        </div>
    );
}

export default MoviesCard;
